import './FoodItem.css';

const FoodItem = () => {
    return (
        <div className="food_item_container">
            <div className="food_item_info">
                <div className="food_item_name">Sushi</div>
                <div className="food_item_description">Finest Fish, with seaweed</div>
                <div className="food_item_price">$22.99</div>
            </div>
            <div className="food_item_form">
                <div className="food_item_form_item">
                    <div className="food_item_form_label">Amount</div>
                    <input className="food_item_form_input" type="number" />
                </div>
                <button className="food_item_add_to_card">Add +</button>
            </div>
        </div>
    )
}

export default FoodItem;
